import TitleComponent from "../components/title.component";

const AuthorsOfTheMonthStyle = styled(motion.div)``;
const AuthorsOfTheMonth = () => {
  return (
    <AuthorsOfTheMonthStyle>
      <TitleComponent
        title={{ text: "Authors of the month" }}
        subtitle={{
          text: "many articles type because of the good trafic we have and our newest authors ebery daymany articles type because of the good trafic we have and our newest authors ebery daymany articles type because of the good trafic we have and our newest authors ebery daymany articles type because of the good trafic we have and our newest authors ebery day",
        }}
      />
    </AuthorsOfTheMonthStyle>
  );
};

export default AuthorsOfTheMonth;
